  \"Hydrogen sulfide monitoring and the effects of oil and gas activities on migratory
  birds in southeastern New Mexico [draft]\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  8,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:34.419685\",\n\t\"name\": \"hydrogen-sulfide-monitoring-and-the-effects-of-oil-and-gas-activities-on-migratory-birds-i\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study examined the effects of hydrogen
  sulfide (H2S), emitted by oil and gas activities, by focusing on migratory birds
  in southeastern New Mexico. Study sites were chosen in southeastern New Mexico near
  the cities of Roswell, Artesia, Clovis, and Carlsbad. H2S monitors were routinely
  deployed in different locations within habitat affected by oil and gas activities
  for over one year. Data collection of H2S concentrations began on November 6, 2002
  and concluded on August 6, 2003. Concentrations of H2S as high as 33 parts per million
  (ppm) were measured near an oil tank, near the town of Maljamar. Point count surveys
  of migratory birds were conducted to determine differences in habitat use of areas
  impacted by oil and gas activities. Point count survey results of migratory birds
  from undisturbed sites (areas without oil and gas activities within 250 meters)
  were compared with disturbed sites (areas affected by oil and gas activities). Point
  count surveys began on November 21, 2002 and concluded on August 6, 2003. There
  were statistically significant differences in the average number of avian individuals
  per point count, the average number of avian species per point count, the species
  diversity, and the average concentration of H2S per point count at disturbed and
  undisturbed sites in Southeast New Mexico.\",\n\t\"license_title\": \"License Not
